actionConfiguration.body:
() => {
  if (appsmith.store.from_page != 'login') {
    console.log('primo if');
    get_all_users.run().then(user_financial_period.run()).then(user_financialNetwork.run()).then(user_financialOffers.run()).then(user_financial_rej_rate_24h.run()).then(user_financial_active_offers.run()).then(user_financial_trend.run());
    return;
  }
  return get_user.run().then(dat => {
    storeValue('id', dat.id);
    storeValue('myUser', dat.id);
    storeValue('myUsers', [dat.id]);
    storeValue('myEmail', dat.email);
    get_user_profile.run({
      user_id: dat.id
    }).then(data => {
      storeValue('first_name', data[0].first_name ? data[0].first_name : get_user.data.user_metadata.full_name.split(' ')[0]);
      storeValue('last_name', data[0].last_name ? data[0].last_name : get_user.data.user_metadata.full_name.split(' ')[1]);
      storeValue('role_level', data[0].role_level);
      update_profile.run();
      storeValue('type', undefined);
      storeValue('from_page', undefined);
    }).then(get_all_users.run()).then(user_financial_period.run()).then(user_financialNetwork.run()).then(user_financialOffers.run()).then(user_financial_rej_rate_24h.run()).then(user_financial_active_offers.run()).then(user_financial_trend.run());
  });
}

